" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 483px\">",
"   <div class=\"ttl\">",
"    Femoral hernia on computed tomography",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 463px; height: 581px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Computed tomography (CT) scan through the femoral heads (A) shows a fat-filled localized mass (white arrow) lateral to the pubic tubercle (white arrowhead) associated with compression of the left femoral vein (white dashed arrow). These findings are consistent with a femoral hernia. The pear-shaped hernia sac is better appreciated in the coronal view (B), which is magnified in (C). There is no evidence of bowel obstruction.",
"    <div class=\"footnotes\">",
