" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Genetics of congenital and acquired long QT syndrome",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
