var title_f28_0_28686="Rx post MI ischemia DANAMI";
var content_f28_0_28686=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58727&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58727&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Revascularization in patients with inducible ischemia after thrombolysis improves outcome",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 383px; height: 433px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The DANAMI study randomly assigned 1008 postinfarction patients with spontaneous or exercise induced ischemia after thrombolytic therapy for acute myocardial infarction (MI) to conservative therapy or invasive therapy with revascularization, if appropriate, based upon anatomy. The invasive strategy significantly reduced the incidence of reinfarction, death, or admission for unstable angina; 44 versus 32 percent at four years (upper panel) but did not affect total mortality (lower panel).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Madsen JK, Grande P, Saunamaki K, et al, on behalf of the DANAMI Study Group, Circulation 1997; 96:748.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
